  \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-central-california-fish-fish-po\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for marine, estuarine, and anadromous fish species in Central California.
  Vector polygons in this data set represent general distribution, nearshore concentration
  areas, spawning areas, and rare species occurrences. Species-specific abundance,
  seasonality, status, life history, and source information are stored in relational
  data tables (described below) designed to be used in conjunction with this spatial
  data layer.This data set comprises a portion of the Environmental Sensitivity Index
  (ESI) data for Central California. ESI data characterize the marine and coastal
  environments and wildlife by their sensitivity to spilled oil. The ESI data include
  information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources. See also the FISHL (Fish Lines) data layer,
  part of the larger Central California ESI database, for additional fish information.\",\n\t\"license_title\":
